import React from 'react';
import {BrowserRouter as Router,Route,Routes,Link} from 'react-router-dom';
import Home from './pages/Home';
import Login from './pages/Login';
import Signin from './pages/Signup';
import Services from './pages/Services';
import './cstream.css'


class Cstream extends React.Component{
    constructor(){
        super()
    }


    render(){
        
        return(
            <>
              <div>
                <Router>
                <ul className='navbar navbar-expand-lg navbar-light fixed-top'>
                    
                    <li className='list' ><Link className='link' style={{textDecoration:"none", color:"white",padding:"50px"}} to="/">HOME</Link></li>
                    <li className='list' ><Link className='link' style={{textDecoration:"none", color:"white",padding:"50px"}} to="/login">LOG IN</Link></li>
                    <li className='list' ><Link className='link' style={{textDecoration:"none", color:"white",padding:"50px"}} to="/signin">SIGN UP</Link></li>
                    <li className='list' ><Link className='link' style={{textDecoration:"none", color:"white",padding:"50px"}} to="/about">SERVICES</Link></li>
                </ul>
                <Routes>
                    <Route path='/' element={<Home/>}></Route>
                    <Route path='/login' element={<Login/>}></Route>
                    <Route path='/signin' element={<Signin/>}></Route>
                    <Route path='/service' element={<Services/>}></Route>
                </Routes>
                </Router>
              </div>
              <table>
                <tr>
                    <th>Contact us</th>
                    <th>About</th>
                </tr>
              </table>
            </>
        )
    }
}


export default Cstream;
